import "./App.css";
import Seat from "./Components/Seat";

function App() {
	const numberOfSeats = 20;
	const [seatSelected, setSeatSelected] = useState("");

	const threeHeaders = Array.from({ length: numberOfSeats }, (_, index) => {
		return (
			<div>
				<p>Upper Deck</p>
				<Seat key={index} value={index} />
			</div>
		);
	});

	return threeHeaders;
}

export default App;
